// SPDX-License-Identifier: MIT
pragma solidity ^0.8.18;

import "contract/Lottery.sol";

contract ParticipantProxy {
    function buyTicketFor(Lottery lottery, uint8[5] calldata numbers) external payable {
        lottery.buyTicket{value: msg.value}(numbers);
    }
}

